description:
This Valley Fog Framed by The Nature Gallery presentation is a photograph mounted, laminated and framed
 	The lamination seals the print and no glass is used and there is no light reflection from the surface of the image
 	It is presented in a wood frame with linen liner
 	Frame and liner add 2.5” in each dimension, so outside dimensions of the framed image are 23” x 29”
 	Please note:  All my artwork, all images, can be custom-sized anywhere in between sizes presented on this website.  Contact me and we can discuss options and do a virtual fitting into your space, be it work or home
 	This print is also available in a gallery wrap canvas format here!

&nbsp;

&nbsp;

&nbsp;

&nbsp;

&nbsp;

Welcome to the whimsical and charming world of Birds on a Wire by Fusion of Iron and Earth. This stunning sculpture is hand-crafted with recycled steel, giving it a unique and beautiful flat black finish.

The three charming birds perched on the wire have a satin finish, adding an extra layer of visual interest. Perfect for bird enthusiasts or fans of nature-inspired art, this sculpture is sure to brighten up any room it occupies. Thanks for considering Birds on a Wire as your next art purchase!

&nbsp;

Introducing SHHHH! artwork by Fusion of Iron and Earth. This unique wood and ceramic sculpture is hand built from ceramics with a custom glaze and India ink, then set on live edge walnut. It's made in the USA and measures 24" x 6" x 3". With its one-of-a-kind design, this beautiful piece is sure to be a conversation starter in any room. Add SHHHH! sculpture art to your home today!

&nbsp;

If SHHHH! has gotten your attention then check out Nest in Branches by Fusion of Iron and Earth—it's worth checking out for sure!

Looking for a one-of-a-kind piece of art to add some personality to your home or office? Check out Blue Bell by Fusion of Iron and Earth. This beautiful sculpture is created from recycled steel and finished with a custom powder coating. It's also made in the USA, so you can feel good about supporting a local artist.

At 37" x 22" x 22", it's the perfect size to make a statement without being too overwhelming. Plus, the blue color is sure to add a pop of color to any space. So why wait? Order Blue Bell today!

&nbsp;
